【商品説明】<br>●進行した薄毛・脱毛の毛生促進、発毛促進を主目的とした発毛促進剤。<br>●バランスよく配合された有効成分が毛穴・毛根部・毛乳頭と毛母細胞・毛細血管の4つのポイントに働き、毛穴環境を整えながら、頭皮の血行を促して毛根部への栄養供給を円滑にし、毛根周囲や毛母細胞・毛乳頭の機能を高め、健やかな新毛の発毛を促します。<br>●薬用植物成分「延命草抽出エキス」「苦参抽出エキス」「セファランチン」配合。<br>●しっとりとした使用感。<br>●<br>●男女共用。<br><br>商品サイズ：71×174×42<br><br>香り：無香料<br><br>効能・効果：薄毛、発毛促進、毛生促進、育毛、脱毛の予防、ふけ、かゆみ、病後・産後の脱毛、養毛<br><br>成分：有効成分：イソプロピルメチルフェノール、エチニルエストラジオール、塩酸ピリドキシン、サリチル酸、カミゲンＥ、カミゲンＫ、セファランチン、その他の成分：水、無水エタノール、パルミチン酸レチノール、グリチルリチン酸モノアンモニウム、酢酸ｄｌ-α-トコフェロール、Ｌ-セリン、濃グリセリン、パントテン酸カルシウム、ビオチン、ｄｌ-メントール、Ｌ-アスパラギン酸カリウム、ＮＮ’-ジアセチル-Ｌ-シスチンジメチルエステル、リノール酸エチル、ブチルヒドロキシアニソール、ジブチルヒドロキシトルエン、ポリソルベート８０、安息香酸ナトリウム、リン酸一水素ナトリウム、クエン酸<br><br>原材料・材質："有効成分：イソプロピルメチルフェノール、エチニルエストラジオール、塩酸ピリドキシン、サリチル酸、カミゲンＥ、カミゲンＫ、セファランチン その他の成分：水、無水エタノール、パルミチン酸レチノール、グリチルリチン酸モノアンモニウム、酢酸ｄｌ-α-トコフェロール、Ｌ-セリン、濃グリセリン、パントテン酸カルシウム、ビオチン、ｄｌ-メントール、Ｌ-アスパラギン酸カリウム、Ｎ<br><br>ご使用上の注意等：・傷、はれもの、湿疹等異常のある部位には使わないでください。<br>・使用中または使用後、赤味、はれ、かゆみ、刺激等の異常が現れたときは使用を中止し、皮膚科専門医等へご相談をおすすめします。<br>・目にはいったときはすぐに洗眼してください。<br>・頭部以外には使用しないでください。<br><br><br>●乳幼児の手の届かないところに保管してください。、●本剤はアルコール製品ですので、保管及び取扱いにあたっては火気に十分注意してください。、●極端に高温または低温の場所、直射日光のあたる場所には保管しないでください。、●使用後は必ずしっかりキャップをしめてください。、<br><br>原産国：日本<br><br>問い合わせ先：株式会社加美乃素本舗、〒651-0055、神戸市中央区熊内橋通3丁目3-25、(078-231-1455<br>区分：医薬部外品<br>JANコード：4987046100467<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
