特製強力 加美乃素A 無香料 180ml<br>薄毛・脱毛の発毛を促進する育毛剤です。無香料。 <br><br>ご注意：<br>●頭皮に異常があるとき、または異常が現れたときはご使用をおやめください。<br>●説明書をよく読んでからお使いください。 　<br><br> お問い合わせ先：<br>株式会社加美乃素本舗078-231-1455 <br><br>販売_製造元： 加美乃素本舗<br>ブランド：加美乃素<br>JAN：4987046100467<p>●薄毛・脱毛の発毛促進に！複合作用で効果を発揮！<br>●頭皮の発毛環境サポート<br>●4つの頭皮柔軟保湿成分が、頭皮のうるおいを適度に保ち発毛しやすい柔軟な頭皮環境づくりをサポート<br>(L-セリン、L-アスパラギン酸カリウム、N N’-ジアセチル-L-シスチンジメチルエステル、ビオチン(ビタミンH))<br>●毛穴環境の清浄化<br>毛穴につまった皮脂、フケ、老廃物を溶解・除去して毛穴を開き、発毛しやすい環境に整え、頭皮、毛穴を清浄に保ちます。<br>(サリチル酸、イソプロピルメチルフェノール、塩酸ピリドキシン)<br>●周辺組織の活性化<br>機能のおとろえた毛根周囲組織を活性化し、より健康的な髪の生育をサポートします。<br>(カミゲンE、カミゲンK、セファランチン、エチニルエストラジオール、ビタミンA、パントテン酸カルシウム、グリチルリチン酸モノアンモニウム)<br>●毛乳頭 毛母細胞の活性化<br>毛髪の生成・成長をコントロールする毛乳頭と細胞分裂して毛髪を形成する毛母細胞を活性化し、発毛エネルギーを高めます。<br>(カミゲンE、カミゲンK、セファランチン、エチニルエストラジオール)<br>●毛細血管の血行促進<br>毛細血管を拡張して血行を促進し、毛根部への毛髪生成の原料となる血液からの栄養供給を高めます。<br>(カミゲンE、カミゲンK、セファランチン) <br><br><br><br>【効能・効果】<br>薄毛、発毛促進、毛生促進、育毛、脱毛の予防、ふけ、かゆみ、病後・産後の脱毛、養毛<br><br>【用法・用量】<br>適宜、適量を頭皮にふりかけ、よくマッサージしてください。<br>※1日2回(朝と夜など)、1回の使用量は3～4mLがめやすです。<br><br>【成分・分量】<br>有効成分・・・カミゲンE(延命草抽出エキス)、カミゲンK(苦参抽出エキス)、セファランチン(玉咲葛藤抽出成分)、塩酸ピリドキシン(ビタミンB6塩酸塩)、エチニルエストラジオール、イソプロピルメチルフェノール、サリチル酸<br>成分・・・水、無水エタノール、パルミチン酸レチノール、グリチルリチン酸モノアンモニウム、酢酸dL-α-トコフェロール、L-セリン、濃グリセリン、パントテン酸カルシウム、ビオチン、dL-メントール、L-アスパラギン酸カリウム、N，N’-ジアセチル-L-シスチンジメチルエステル、リノール酸エチル、ブチルヒドロキシアニソール、ジブチルヒドロキシトルエン、ポリソルベート80、安息香酸ナトリウム、リン酸一水素ナトリウム、クエン酸</p><br><br>CS：24<br><br>区分：医薬部外品 <br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
