【商品説明】<br>毛髪由来アミノ酸※新配合（保湿成分：L-システイン塩酸塩）。髪にハリとコシを与え、髪のボリューム感をアップします。<br>●生薬（ショウキョウ、センブリ、ニンジン）で、血流を促進し、抜け毛予防＆育毛<br>●殺菌成分（シメンー５－オール）が頭皮を清潔に保ちます。<br>●天然清涼成分（ハッカ油）で頭皮スッキリ。<br>●植物性保湿成分（ホップエキス）で頭皮柔軟<br>●水溶性高分子で液だれなし<br><br>商品サイズ：53×200×53<br><br>香り：無香料<br><br>効能・効果：脱毛の予防、育毛、薄毛、ふけ、かゆみ、発毛促進<br><br>成分：有効成分ニンジンエキス、センブリエキス、ショウキョウエキス、シメン-5-オール その他の成分DME、無水エタノール、Ｌ－システイン塩酸塩、ホップエキス、メントール、ハッカ油、BG、エタノール、DIPA、エデト酸塩、パラベン、粘度調整剤<br><br>ご使用上の注意等：●本品の目的以外の用途には使用しないでください。<br>●頭皮に傷・湿しん等の異常がある場合は、使用をしないでください。<br>●使用中、赤み・かゆみ・刺激等の異常が現れた場合、使用を中止し、皮フ科専門医へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>●目に入らないようにご注意ください。目に入った場合は、すぐに水又はぬるま湯で十分に洗い流してください。又、まぶたの周囲、粘膜等にスプレーしないでください。●噴射ガスは、直接吸入しないようご注意ください。<br>●乳幼児の手の届く所に保管しないでください<br>高圧ガスを使用した可燃性の製品であり、危険なため、下記の注意を守ること。 、炎や火気の近くで使用しないこと。火気を使用している室内で大量に使用しないこと。高温にすると破裂の危険があるため、直射日光の当たる所やストーブ、ファンヒーターの近くなど温度が４０度以上となる所に置かないこと。 、火の中に入れないこと。 、使い切って捨てること。 高圧ガス：ＤＭＥ　<br><br>原産国：日本<br><br>問い合わせ先：株式会社バスクリン 〒108-0023東京都港区芝浦4-3-4 お客様窓口 ０１２０－３９－８４９６<br>区分：医薬部外品<br>JANコード：4548514510746<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
